import pytest
from app import app

@pytest.fixture
def client():
    app.config['TESTING'] = True
    client = app.test_client()
    yield client

def test_get_data_route(client):
    response = client.get('/api/data')
    assert response.status_code == 200
    data = response.get_json()
    assert 'error' not in data  # Tidak boleh ada 'error' dalam respons
    assert 'message' not in data  # Tidak boleh ada 'message' dalam respons

def test_add_data_route(client):
    # Gantilah data yang sesuai dengan format permintaan Anda
    request_data = {
        "cabang" : "KWM",
        "file" : ""

    }
    response = client.post('/api/data', json=request_data)
    assert response.status_code == 201
    data = response.get_json()
    assert 'error' not in data  # Tidak boleh ada 'error' dalam respons
    assert 'message' in data  # Harus ada 'message' dalam respons
    assert 'data' in data  # Harus ada 'data' dalam respons
